import '../App.css';
import movies from'../movies.json'
import PokemonCard from './PokemonCard';

const Home= ()=>{

    return(
        <div>
            <ul>
               {
                movies.map((m)=>{
                    <PokemonCard key={m.id} movie={m} />
                })
               }
               
            </ul>
        </div>
    );
}
export default Home
